import React from "react";
import './styles/button.css';
const ButtonV1 = ({onClick,title}) => {
    return(
        // <div className='Button-text-1'>
            <button className='button V1 tx-white bg-green' onClick={onClick}>{title}</button>
        // </div>
    );
};
const ButtonV2 = ({onClick,title}) => {
    return(
        <div className='Button-text-1  '>
            <button className='button V2 tx-green bg-none' onClick={onClick}>{title}</button>
        </div>
    );
};
export {ButtonV1,ButtonV2};
